          />
        </label>
        <label htmlFor="password">
          Senha:
          <input
            type="password"
            placeholder="Insira sua senha"
            id="password"
            name="password"
            // value={ '' }
            // onChange = { () => {} }
          />
        </label>
      </form>
      <button
        type="button"
        onClick={ () => {} }
      >
        Login
      </button>
      <Link to="/newuser">Criar novo usuário</Link>
    </div>
  );
}

export default Login;
